import matplotlib.image as mpimg
from PIL import Image
from io import BytesIO
import base64

leg1_png = ""
leg2_png = ""
dot_png = ""
bkg_png = ""

w1, h1, w2, h2, w3, h3, w4, h4 = 731, 572, 633, 431, 47, 48, 600, 600 # 原尺寸

def readleg1():
    image = base64.b64decode(leg1_png)
    image = BytesIO(image)
    image = Image.open(image)
    image = image.resize((int(w1*2/3),int(h1*2/3)), Image.ANTIALIAS)
    leg1 = mpimg.pil_to_array(image)
    return leg1

def readleg2():
    image = base64.b64decode(leg2_png)
    image = BytesIO(image)
    image = Image.open(image)
    image = image.resize((int(w2*2/3),int(h2*2/3)), Image.ANTIALIAS)
    leg2 = mpimg.pil_to_array(image)
    return leg2

def readdot():
    image = base64.b64decode(dot_png)
    image = BytesIO(image)
    image = Image.open(image)
    image = image.resize((int(w3),int(h3)), Image.ANTIALIAS)
    dot = mpimg.pil_to_array(image)
    return dot

def readbkg():
    image = base64.b64decode(bkg_png)
    image = BytesIO(image)
    image = Image.open(image)
    image = image.resize((int(w4), int(h4)), Image.ANTIALIAS)
    bkg = mpimg.pil_to_array(image)
    return bkg